INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (1, N'1.1', N'By 2030, eradicate extreme poverty for all people everywhere, currently measured as people living on less than $1.25 a day', NULL, NULL, N'1.1')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (1, N'1.2', N'By 2030, reduce at least by half the proportion of men, women and children of all ages living in poverty in all its dimensions according to national definitions', NULL, NULL, N'1.2')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (1, N'1.3', N'Implement nationally appropriate social protection systems and measures for all, including floors, and by 2030 achieve substantial coverage of the poor and the vulnerable', NULL, NULL, N'1.3')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (1, N'1.4', N'By 2030, ensure that all men and women, in particular the poor and the vulnerable, have equal rights to economic resources, as well as access to basic services, ownership and control over land and other forms of property, inheritance, natural resources, appropriate new technology and financial services, including microfinance', NULL, NULL, N'1.4')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (1, N'1.5', N'By 2030, build the resilience of the poor and those in vulnerable situations and reduce their exposure and vulnerability to climate-related extreme events and other economic, social and environmental shocks and disasters', NULL, NULL, N'1.5')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (1, N'1.a', N'Ensure significant mobilization of resources from a variety of sources, including through enhanced development cooperation, in order to provide adequate and predictable means for developing countries, in particular least developed countries, to implement programmes and policies to end poverty in all its dimensions', NULL, NULL, N'1.a')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (1, N'1.b', N'Create sound policy frameworks at the national, regional and international levels, based on pro-poor and gender-sensitive development strategies, to support accelerated investment in poverty eradication actions', NULL, NULL, N'1.b')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (10, N'10.1', N'By 2030, progressively achieve and sustain income growth of the bottom 40 per cent of the population at a rate higher than the national average', NULL, NULL, N'10.1')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (10, N'10.2', N'By 2030, empower and promote the social, economic and political inclusion of all, irrespective of age, sex, disability, race, ethnicity, origin, religion or economic or other status', NULL, NULL, N'10.2')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (10, N'10.3', N'Ensure equal opportunity and reduce inequalities of outcome, including by eliminating discriminatory laws, policies and practices and promoting appropriate legislation, policies and action in this regard', NULL, NULL, N'10.3')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (10, N'10.4', N'Adopt policies, especially fiscal, wage and social protection policies, and progressively achieve greater equality', NULL, NULL, N'10.4')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (10, N'10.5', N'Improve the regulation and monitoring of global financial markets and institutions and strengthen the implementation of such regulations', NULL, NULL, N'10.5')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (10, N'10.6', N'Ensure enhanced representation and voice for developing countries in decision-making in global international economic and financial institutions in order to deliver more effective, credible, accountable and legitimate institutions', NULL, NULL, N'10.6')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (10, N'10.7', N'Facilitate orderly, safe, regular and responsible migration and mobility of people, including through the implementation of planned and well-managed migration policies', NULL, NULL, N'10.7')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (10, N'10.a', N'Implement the principle of special and differential treatment for developing countries, in particular least developed countries, in accordance with World Trade Organization agreements', NULL, NULL, N'10.a')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (10, N'10.b', N'Encourage official development assistance and financial flows, including foreign direct investment, to States where the need is greatest, in particular least developed countries, African countries, small island developing States and landlocked developing countries, in accordance with their national plans and programmes', NULL, NULL, N'10.b')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (10, N'10.c', N'By 2030, reduce to less than 3 per cent the transaction costs of migrant remittances and eliminate remittance corridors with costs higher than 5 per cent', NULL, NULL, N'10.c')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (11, N'11.1', N'By 2030, ensure access for all to adequate, safe and affordable housing and basic services and upgrade slums', NULL, NULL, N'11.1')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (11, N'11.2', N'By 2030, provide access to safe, affordable, accessible and sustainable transport systems for all, improving road safety, notably by expanding public transport, with special attention to the needs of those in vulnerable situations, women, children, persons with disabilities and older persons', NULL, NULL, N'11.2')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (11, N'11.3', N'By 2030, enhance inclusive and sustainable urbanization and capacity for participatory, integrated and sustainable human settlement planning and management in all countries', NULL, NULL, N'11.3')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (11, N'11.4', N'Strengthen efforts to protect and safeguard the world’s cultural and natural heritage', NULL, NULL, N'11.4')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (11, N'11.5', N'By 2030, significantly reduce the number of deaths and the number of people affected and substantially decrease the direct economic losses relative to global gross domestic product caused by disasters, including water-related disasters, with a focus on protecting the poor and people in vulnerable situations', NULL, NULL, N'11.5')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (11, N'11.6', N'By 2030, reduce the adverse per capita environmental impact of cities, including by paying special attention to air quality and municipal and other waste management', NULL, NULL, N'11.6')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (11, N'11.7', N'By 2030, provide universal access to safe, inclusive and accessible, green and public spaces, in particular for women and children, older persons and persons with disabilities', NULL, NULL, N'11.7')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (11, N'11.a', N'Support positive economic, social and environmental links between urban, peri-urban and rural areas by strengthening national and regional development planning', NULL, NULL, N'11.a')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (11, N'11.b', N'By 2020, substantially increase the number of cities and human settlements adopting and implementing integrated policies and plans towards inclusion, resource efficiency, mitigation and adaptation to climate change, resilience to disasters, and develop and implement, in line with the Sendai Framework for Disaster Risk Reduction 2015–2030, holistic disaster risk management at all levels', NULL, NULL, N'11.b')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (11, N'11.c', N'Support least developed countries, including through financial and technical assistance, in building sustainable and resilient buildings utilizing local materials', NULL, NULL, N'11.c')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (12, N'12.1', N'Implement the 10 Year Framework of Programmes on Sustainable Consumption and Production Patterns, all countries taking action, with developed countries taking the lead, taking into account the development and capabilities of developing countries', NULL, NULL, N'12.1')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (12, N'12.2', N'By 2030, achieve the sustainable management and efficient use of natural resources', NULL, NULL, N'12.2')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (12, N'12.3', N'By 2030, halve per capita global food waste at the retail and consumer levels and reduce food losses along production and supply chains, including post-harvest losses', NULL, NULL, N'12.3')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (12, N'12.4', N'By 2020, achieve the environmentally sound management of chemicals and all wastes throughout their life cycle, in accordance with agreed international frameworks, and significantly reduce their release to air, water and soil in order to minimize their adverse impacts on human health and the environment', NULL, NULL, N'12.4')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (12, N'12.5', N'By 2030, substantially reduce waste generation through prevention, reduction, recycling and reuse', NULL, NULL, N'12.5')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (12, N'12.6', N'Encourage companies, especially large and transnational companies, to adopt sustainable practices and to integrate sustainability information into their reporting cycle', NULL, NULL, N'12.6')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (12, N'12.7', N'Promote public procurement practices that are sustainable, in accordance with national policies and priorities', NULL, NULL, N'12.7')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (12, N'12.8', N'By 2030, ensure that people everywhere have the relevant information and awareness for sustainble development and lifestyles in harmony with nature', NULL, NULL, N'12.8')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (12, N'12.a', N'Support developing countries to strengthen their scientific and technological capacity to move towards more sustainable patterns of consumption and production', NULL, NULL, N'12.a')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (12, N'12.b', N'Develop and implement tools to monitor sustainable development impacts for sustainable tourism that creates jobs and promotes local culture and products', NULL, NULL, N'12.b')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (12, N'12.c', N'Rationalize inefficient fossil-fuel subsidies that encourage wasteful consumption by removing market distortions, in accordance with national circumstances, including by restructuring taxation and phasing out those harmful subsidies, where they exist, to reflect their environmental impacts, taking fully into account the specific needs and conditions of developing countries and minimizing the possible adverse impacts on their development in a manner that protects the poor and the affected communities', NULL, NULL, N'12.c')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (13, N'13.1', N'Strengthen resilience and adaptive capacity to climate-related hazards and natural disasters in all countries', NULL, NULL, N'13.1')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (13, N'13.2', N'Integrate climate change measures into national policies, strategies and planning', NULL, NULL, N'13.2')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (13, N'13.3', N'Improve education, awareness-raising and human and institutional capacity on climate change mitigation, adaptation, impact reduction and early warning', NULL, NULL, N'13.3')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (13, N'13.a', N'Implement the commitment undertaken by developed-country parties to the United Nations Framework Convention on Climate Change to a goal of mobilizing jointly $100 billion annually by 2020 from all sources to address the needs of developing countries in the context of meaningful mitigation actions and transparency on implementation and fully operationalize the Green Climate Fund through its capitalization as soon as possible', NULL, NULL, N'13.a')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (13, N'13.b', N'Promote mechanisms for raising capacity for effective climate change-related planning and management in least developed countries and small island developing States, including focusing on women, youth and local and marginalized communities', NULL, NULL, N'13.b')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (14, N'14.1', N'By 2025, prevent and significantly reduce marine pollution of all kinds, in particular from land-based activities, including marine debris and nutrient pollution', NULL, NULL, N'14.1')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (14, N'14.2', N'By 2020, sustainably manage and protect marine and coastal ecosystems to avoid significant adverse impacts, including by strengthening their resilience, and take action for their restoration in order to achieve healthy and productive oceans', NULL, NULL, N'14.2')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (14, N'14.3', N'Minimize and address the impacts of ocean acidification, including through enhanced scientific cooperation at all levels', NULL, NULL, N'14.3')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (14, N'14.4', N'By 2020, effectively regulate harvesting and end overfishing, illegal, unreported and unregulated fishing and destructive fishing practices and implement science-based management plans, in order to restore fish stocks in the shortest time feasible, at least to levels that can produce maximum sustainable yield as determined by their biological characteristics', NULL, NULL, N'14.4')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (14, N'14.5', N'By 2020, conserve at least 10 per cent of coastal and marine areas, consistent with national and international law and based on the best available scientific information', NULL, NULL, N'14.5')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (14, N'14.6', N'By 2020, prohibit certain forms of fisheries subsidies which contribute to overcapacity and overfishing, eliminate subsidies that contribute to illegal, unreported and unregulated fishing and refrain from introducing new such subsidies, recognizing that appropriate and effective special and differential treatment for developing and least developed countries should be an integral part of the World Trade Organization fisheries subsidies negotiation[2]', NULL, NULL, N'14.6')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (14, N'14.7', N'By 2030, increase the economic benefits to small island developing States and least developed countries from the sustainable use of marine resources, including through sustainable management of fisheries, aquaculture and tourism', NULL, NULL, N'14.7')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (14, N'14.a', N'Increase scientific knowledge, develop research capacity and transfer marine technology, taking into account the Intergovernmental Oceanographic Commission Criteria and Guidelines on the Transfer of Marine Technology, in order to improve ocean health and to enhance the contribution of marine biodiversity to the development of developing countries, in particular small island developing States and least developed countries', NULL, NULL, N'14.a')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (14, N'14.b', N'Provide access for small-scale artisanal fishers to marine resources and markets', NULL, NULL, N'14.b')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (14, N'14.c', N'Enhance the conservation and sustainable use of oceans and their resources by implementing international law as reflected in the United Nations Convention on the Law of the Sea, which provides the legal framework for the conservation and sustainable use of oceans and their resources, as recalled in paragraph 158 of “The future we want”', NULL, NULL, N'14.c')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (15, N'15.1', N'By 2020, ensure the conservation, restoration and sustainable use of terrestrial and inland freshwater ecosystems and their services, in particular forests, wetlands, mountains and drylands, in line with obligations under international agreements', NULL, NULL, N'15.1')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (15, N'15.2', N'By 2020, promote the implementation of sustainable management of all types of forests, halt deforestation, restore degraded forests and substantially increase afforestation and reforestation globally', NULL, NULL, N'15.2')
