INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (15, N'15.6', N' Promote fair and equitable sharing of the benefits arising from the utilization of genetic resources and promote appropriate access to such resources, as internationally agreed', NULL, NULL, N'15.6')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (15, N'15.7', N' Take urgent action to end poaching and trafficking of protected species of flora and fauna and address both demand and supply of illegal wildlife products', NULL, NULL, N'15.7')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (15, N'15.8', N'By 2020, introduce measures to prevent the introduction and significantly reduce the impact of invasive alien species on land and water ecosystems and control or eradicate the priority species', NULL, NULL, N'15.8')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (15, N'15.9', N'By 2020, integrate ecosystem and biodiversity values into national and local planning, development processes, poverty reduction strategies and accounts', NULL, NULL, N'15.9')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (15, N'15.a', N'Mobilize and significantly increase financial resources from all sources to conserve and sustainably use biodiversity and ecosystems', NULL, NULL, N'15.a')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (15, N'15.b', N'Mobilize significant resources from all sources and at all levels to finance sustainable forest management and provide adequate incentives to developing countries to advance such management, including for conservation and reforestation', NULL, NULL, N'15.b')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (15, N'15.c', N'Enhance global support for efforts to combat poaching and trafficking of protected species, including by increasing the capacity of local communities to pursue sustainable livelihood opportunities', NULL, NULL, N'15.c')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (16, N'16.1', N'Significantly reduce all forms of violence and related death rates everywhere', NULL, NULL, N'16.1')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (16, N'16.2', N'End abuse, exploitation, trafficking and all forms of violence against and torture of children', NULL, NULL, N'16.2')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (16, N'16.3', N'Promote the rule of law at the national and international levels and ensure equal access to justice for all', NULL, NULL, N'16.3')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (16, N'16.4', N'By 2030, significantly reduce illicit financial and arms flows, strengthen the recovery and return of stolen assets and combat all forms of organized crime', NULL, NULL, N'16.4')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (16, N'16.5', N'Substantially reduce corruption and bribery in all their forms', NULL, NULL, N'16.5')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (16, N'16.6', N'Develop effective, accountable and transparent institutions at all levels', NULL, NULL, N'16.6')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (16, N'16.7', N'Ensure responsive, inclusive, participatory and representative decision-making at all levels', NULL, NULL, N'16.7')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (16, N'16.8', N'Broaden and strengthen the participation of developing countries in the institutions of global governance', NULL, NULL, N'16.8')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (16, N'16.9', N'By 2030, provide legal identity for all, including birth registration', NULL, NULL, N'16.9')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (16, N'16.a', N'Strengthen relevant national institutions, including through international cooperation, for building capacity at all levels, in particular in developing countries, to prevent violence and combat terrorism and crime', NULL, NULL, N'16.a')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (16, N'16.b', N'Promote and enforce non-discriminatory laws and policies for sustainable development', NULL, NULL, N'16.b')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.1', N'Strengthen domestic resource mobilization, including through international support to developing countries, to improve domestic capacity for tax and other revenue collection', NULL, NULL, N'17.1')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.10', N'Promote a universal, rules-based, open, non-discriminatory and equitable multilateral trading system under the World Trade Organization, including through the conclusion of negotiations under its Doha Development Agenda', NULL, NULL, N'17.10')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.11', N'Significantly increase the exports of developing countries, in particular with a view to doubling the least developed countries’ share of global exports by 2020', NULL, NULL, N'17.11')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.12', N'Realize timely implementation of duty-free and quota-free market access on a lasting basis for all least developed countries, consistent with World Trade Organization decisions, including by ensuring that preferential rules of origin applicable to imports from least developed countries are transparent and simple, and contribute to facilitating market access', NULL, NULL, N'17.12')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.13', N'Enhance global macroeconomic stability, including through policy coordination and policy coherence', NULL, NULL, N'17.13')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.14', N'Enhance policy coherence for sustainable development', NULL, NULL, N'17.14')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.15', N'Respect each country’s policy space and leadership to establish and implement policies for poverty eradication and sustainable development', NULL, NULL, N'17.15')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.16', N'Enhance the Global Partnership for Sustainable Development, complemented by multi-stakeholder partnerships that mobilize and share knowledge, expertise, technology and financial resources, to support the achievement of the Sustainable Development Goals in all countries, in particular developing countries', NULL, NULL, N'17.16')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.17', N'Encourage and promote effective public, public-private and civil society partnerships, building on the experience and resourcing strategies of partnerships', NULL, NULL, N'17.17')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.18', N'By 2020, enhance capacity-building support to developing countries, including for least developed countries and small island developing States, to increase significantly the availability of high-quality, timely and reliable data disaggregated by income, gender, age, race, ethnicity, migratory status, disability, geographic location and other characteristics relevant in national contexts', NULL, NULL, N'17.18')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.19', N'By 2030, build on existing initiatives to develop measurements of progress on sustainable development that complement gross domestic product, and support statistical capacity-building in developing countries', NULL, NULL, N'17.19')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.2', N'Developed countries to implement fully their official development assistance commitments, including the commitment by many developed countries to achieve the target of 0.7 per cent of gross national income for official development assistance (ODA/GNI) to developing countries and 0.15 to 0.20 per cent of ODA/GNI to least developed countries; ODA providers are encouraged to consider setting a target to provide at least 0.20 per cent of ODA/GNI to least developed countries', NULL, NULL, N'17.2')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.3', N'Mobilize additional financial resources for developing countries from multiple sources', NULL, NULL, N'17.3')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.4', N'Assist developing countries in attaining long-term debt sustainability through coordinated policies aimed at fostering debt financing, debt relief and debt restructuring, as appropriate, and address the external debt of highly indebted poor countries to reduce debt distress', NULL, NULL, N'17.4')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.5', N'Adopt and implement investment promotion regimes for least developed countries', NULL, NULL, N'17.5')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.6', N'Enhance North-South, South-South and triangular regional and international cooperation on and access to science, technology and innovation and enhance knowledge sharing on mutually agreed terms, including through improved coordination among existing mechanisms, in particular at the United Nations level, and through a global technology facilitation mechanism', NULL, NULL, N'17.6')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.7', N'Promote the development, transfer, dissemination and diffusion of environmentally sound technologies to developing countries on favourable terms, including on concessional and preferential terms, as mutually agreed', NULL, NULL, N'17.7')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.8', N'Fully operationalize the technology bank and science, technology and innovation capacity-building mechanism for least developed countries by 2017 and enhance the use of enabling technology, in particular information and communications technology', NULL, NULL, N'17.8')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (17, N'17.9', N'Enhance international support for implementing effective and targeted capacity-building in developing countries to support national plans to implement all the Sustainable Development Goals, including through North-South, South-South and triangular cooperation', NULL, NULL, N'17.9')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (2, N'2.1', N'By 2030, end hunger and ensure access by all people, in particular the poor and people in vulnerable situations, including infants, to safe, nutritious and sufficient food all year round', NULL, NULL, N'2.1')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (2, N'2.2', N'By 2030, end all forms of malnutrition, including achieving, by 2025, the internationally agreed targets on stunting and wasting in children under 5 years of age, and address the nutritional needs of adolescent girls, pregnant and lactating women and older persons', NULL, NULL, N'2.2')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (2, N'2.3', N'By 2030, double the agricultural productivity and incomes of small-scale food producers, in particular women, indigenous peoples, family farmers, pastoralists and fishers, including through secure and equal access to land, other productive resources and inputs, knowledge, financial services, markets and opportunities for value addition and non-farm employment', NULL, NULL, N'2.3')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (2, N'2.4', N'By 2030, ensure sustainable food production systems and implement resilient agricultural practices that increase productivity and production, that help maintain ecosystems, that strengthen capacity for adaptation to climate change, extreme weather, drought, flooding and other disasters and that progressively improve land and soil quality', NULL, NULL, N'2.4')
GO
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (2, N'2.5', N'By 2020, maintain the genetic diversity of seeds, cultivated plants and farmed and domesticated animals and their related wild species, including through soundly managed and diversified seed and plant banks at the national, regional and international levels, and promote access to and fair and equitable sharing of benefits arising from the utilization of genetic resources and associated traditional knowledge, as internationally agreed', NULL, NULL, N'2.5')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (2, N'2.a', N'Increase investment, including through enhanced international cooperation, in rural infrastructure, agricultural research and extension services, technology development and plant and livestock gene banks in order to enhance agricultural productive capacity in developing countries, in particular least developed countries', NULL, NULL, N'2.a')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (2, N'2.b', N'Correct and prevent trade restrictions and distortions in world agricultural markets, including through the parallel elimination of all forms of agricultural export subsidies and all export measures with equivalent effect, in accordance with the mandate of the Doha Development Round', NULL, NULL, N'2.b')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (2, N'2.c', N'Adopt measures to ensure the proper functioning of food commodity markets and their derivatives and facilitate timely access to market information, including on food reserves, in order to help limit extreme food price volatility', NULL, NULL, N'2.c')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (3, N'3.1', N'By 2030, reduce the global maternal mortality ratio to less than 70 per 100,000 live births', NULL, NULL, N'3.1')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (3, N'3.2', N'By 2030, end preventable deaths of newborns and children under 5 years of age, with all countries aiming to reduce neonatal mortality to at least as low as 12 per 1,000 live births and under 5 mortality to at least as low as 25 per 1,000 live births', NULL, NULL, N'3.2')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (3, N'3.3', N'By 2030, end the epidemics of AIDS, tuberculosis, malaria and neglected tropical diseases and combat hepatitis, water-borne diseases and other communicable diseases', NULL, NULL, N'3.3')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (3, N'3.4', N' By 2030, reduce by one third premature mortality from non-communicable diseases through prevention and treatment and promote mental health and well-being', NULL, NULL, N'3.4')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (3, N'3.5', N'Strengthen the prevention and treatment of substance abuse, including narcotic drug abuse and harmful use of alcohol', NULL, NULL, N'3.5')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (3, N'3.6', N'By 2020, halve the number of global deaths and injuries from road traffic accidents', NULL, NULL, N'3.6')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (3, N'3.7', N'By 2030, ensure universal access to sexual and reproductive health-care services, including for family planning, information and education, and the integration of reproductive health into national strategies and programmes', NULL, NULL, N'3.7')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (3, N'3.8', N'Achieve universal health coverage, including financial risk protection, access to quality essential health-care services and access to safe, effective, quality and affordable essential medicines and vaccines for all', NULL, NULL, N'3.8')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (3, N'3.9', N'By 2030, substantially reduce the number of deaths and illnesses from hazardous chemicals and air, water and soil pollution and contamination', NULL, NULL, N'3.9')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (3, N'3.a', N'Strengthen the implementation of the World Health Organization Framework Convention on Tobacco Control in all countries, as appropriate', NULL, NULL, N'3.a')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (3, N'3.b', N'Support the research and development of vaccines and medicines for the communicable and non-communicable diseases that primarily affect developing countries, provide access to affordable essential medicines and vaccines, in accordance with the Doha Declaration on the TRIPS Agreement and Public Health, which affirms the right of developing countries to use to the full the provisions in the Agreement on Trade-Related Aspects of Intellectual Property Rights regarding flexibilities to protect public health, and, in particular, provide access to medicines for all', NULL, NULL, N'3.b')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (3, N'3.c', N'Substantially increase health financing and the recruitment, development, training and retention of the health workforce in developing countries, especially in least developed countries and small island developing States', NULL, NULL, N'3.c')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (3, N'3.d', N'Strengthen the capacity of all countries, in particular developing countries, for early warning, risk reduction and management of national and global health risks', NULL, NULL, N'3.d')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (4, N'4.1', N'By 2030, ensure that all girls and boys complete free, equitable and quality primary and secondary education leading to relevant and effective learning outcomes', NULL, NULL, N'4.1')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (4, N'4.2', N'By 2030, ensure that all girls and boys have access to quality early childhood development, care and pre-primary education so that they are ready for primary education', NULL, NULL, N'4.2')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (4, N'4.3', N'By 2030, ensure equal access for all women and men to affordable and quality technical, vocational and tertiary education, including university', NULL, NULL, N'4.3')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (4, N'4.4', N'By 2030, substantially increase the number of youth and adults who have relevant skills, including technical and vocational skills, for employment, decent jobs and entrepreneurship', NULL, NULL, N'4.4')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (4, N'4.5', N'By 2030, eliminate gender disparities in education and ensure equal access to all levels of education and vocational training for the vulnerable, including persons with disabilities, indigenous peoples and children in vulnerable situations', NULL, NULL, N'4.5')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (4, N'4.6', N'By 2030, ensure that all youth and a substantial proportion of adults, both men and women, achieve literacy and numeracy', NULL, NULL, N'4.6')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (4, N'4.7', N'By 2030, ensure that all learners acquire the knowledge and skills needed to promote sustainable development, including, among others, through education for sustainable development and sustainable lifestyles, human rights, gender equality, promotion of a culture of peace and non-violence, global citizenship and appreciation of cultural diversity and of culture’s contribution to sustainable development', NULL, NULL, N'4.7')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (4, N'4.a', N'Build and upgrade education facilities that are child, disability and gender sensitive and provide safe, non-violent, inclusive and effective learning environments for all', NULL, NULL, N'4.a')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (4, N'4.b', N'By 2020, substantially expand globally the number of scholarships available to developing countries, in particular least developed countries, small island developing States and African countries, for enrolment in higher education, including vocational training and information and communications technology, technical, engineering and scientific programmes, in developed countries and other developing countries', NULL, NULL, N'4.b')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (4, N'4.c', N'By 2030, substantially increase the supply of qualified teachers, including through international cooperation for teacher training in developing countries, especially least developed countries and small island developing States', NULL, NULL, N'4.c')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (5, N'5.1', N'End all forms of discrimination against all women and girls everywhere', NULL, NULL, N'5.1')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (5, N'5.2', N'Eliminate all forms of violence against all women and girls in the public and private spheres, including trafficking and sexual and other types of exploitation', NULL, NULL, N'5.2')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (5, N'5.3', N'Eliminate all harmful practices, such as child, early and forced marriage and female genital mutilation', NULL, NULL, N'5.3')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (5, N'5.4', N'Recognize and value unpaid care and domestic work through the provision of public services, infrastructure and social protection policies and the promotion of shared responsibility within the household and the family as nationally appropriate', NULL, NULL, N'5.4')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (5, N'5.5', N'Ensure women’s full and effective participation and equal opportunities for leadership at all levels of decision-making in political, economic and public life', NULL, NULL, N'5.5')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (5, N'5.6', N'Ensure universal access to sexual and reproductive health and reproductive rights as agreed in accordance with the Programme of Action of the International Conference on Population and Development and the Beijing Platform for Action and the outcome documents of their review conferences', NULL, NULL, N'5.6')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (5, N'5.a', N'Undertake reforms to give women equal rights to economic resources, as well as access to ownership and control over land and other forms of property, financial services, inheritance and natural resources, in accordance with national laws', NULL, NULL, N'5.a')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (5, N'5.b', N'Enhance the use of enabling technology, in particular information and communications technology, to promote the empowerment of women', NULL, NULL, N'5.b')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (5, N'5.c', N'Adopt and strengthen sound policies and enforceable legislation for the promotion of gender equality and the empowerment of all women and girls at all levels', NULL, NULL, N'5.c')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (6, N'6.1', N'By 2030, achieve universal and equitable access to safe and affordable drinking water for all', NULL, NULL, N'6.1')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (6, N'6.2', N'By 2030, achieve access to adequate and equitable sanitation and hygiene for all and end open defecation, paying special attention to the needs of women and girls and those in vulnerable situations', NULL, NULL, N'6.2')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (6, N'6.3', N'By 2030, improve water quality by reducing pollution, eliminating dumping and minimizing release of hazardous chemicals and materials, halving the proportion of untreated wastewater and substantially increasing recycling and safe reuse globally', NULL, NULL, N'6.3')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (6, N'6.4', N'By 2030, substantially increase water-use efficiency across all sectors and ensure sustainable withdrawals and supply of freshwater to address water scarcity and substantially reduce the number of people suffering from water scarcity', NULL, NULL, N'6.4')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (6, N'6.5', N'By 2030, implement integrated water resources management at all levels, including through transboundary cooperation as appropriate', NULL, NULL, N'6.5')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (6, N'6.6', N'By 2020, protect and restore water-related ecosystems, including mountains, forests, wetlands, rivers, aquifers and lakes', NULL, NULL, N'6.6')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (6, N'6.a', N'By 2030, expand international cooperation and capacity-building support to developing countries in water- and sanitation-related activities and programmes, including water harvesting, desalination, water efficiency, wastewater treatment, recycling and reuse technologies', NULL, NULL, N'6.a')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (6, N'6.b', N'Support and strengthen the participation of local communities in improving water and sanitation management', NULL, NULL, N'6.b')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (7, N'7.1', N'By 2030, ensure universal access to affordable, reliable and modern energy services', NULL, NULL, N'7.1')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (7, N'7.2', N'By 2030, increase substantially the share of renewable energy in the global energy mix', NULL, NULL, N'7.2')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (7, N'7.3', N'By 2030, double the global rate of improvement in energy efficiency', NULL, NULL, N'7.3')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (7, N'7.a', N'By 2030, enhance international cooperation to facilitate access to clean energy research and technology, including renewable energy, energy efficiency and advanced and cleaner fossil-fuel technology, and promote investment in energy infrastructure and clean energy technology', NULL, NULL, N'7.a')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (7, N'7.b', N'By 2030, expand infrastructure and upgrade technology for supplying modern and sustainable energy services for all in developing countries, in particular least developed countries, small island developing States and landlocked developing countries, in accordance with their respective programmes of support', NULL, NULL, N'7.b')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (8, N'8.1', N'Sustain per capita economic growth in accordance with national circumstances and, in particular, at least 7 per cent gross domestic product growth per annum in the least developed countries', NULL, NULL, N'8.1')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (8, N'8.10', N'Sustain per capita economic growth in accordance with national circumstances and, in particular, at least 7 per cent gross domestic product growth per annum in the least developed countries', NULL, NULL, N'8.10')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (8, N'8.2', N'Achieve higher levels of economic productivity through diversification, technological upgrading and innovation, including through a focus on high-value added and labour-intensive sectors', NULL, NULL, N'8.2')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (8, N'8.3', N'Promote development-oriented policies that support productive activities, decent job creation, entrepreneurship, creativity and innovation, and encourage the formalization and growth of micro-, small- and medium-sized enterprises, including through access to financial services', NULL, NULL, N'8.3')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (8, N'8.4', N'Improve progressively, through 2030, global resource efficiency in consumption and production and endeavour to decouple economic growth from environmental degradation, in accordance with the 10-Year Framework of Programmes on Sustainable Consumption and Production, with developed countries taking the lead', NULL, NULL, N'8.4')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (8, N'8.5', N'By 2030, achieve full and productive employment and decent work for all women and men, including for young people and persons with disabilities, and equal pay for work of equal value', NULL, NULL, N'8.5')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (8, N'8.6', N'By 2020, substantially reduce the proportion of youth not in employment, education or training', NULL, NULL, N'8.6')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (8, N'8.7', N'Take immediate and effective measures to eradicate forced labour, end modern slavery and human trafficking and secure the prohibition and elimination of the worst forms of child labour, including recruitment and use of child soldiers, and by 2025 end child labour in all its forms', NULL, NULL, N'8.7')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (8, N'8.8', N'Protect labour rights and promote safe and secure working environments for all workers, including migrant workers, in particular women migrants, and those in precarious employment', NULL, NULL, N'8.8')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (8, N'8.9', N'By 2030, devise and implement policies to promote sustainable tourism that creates jobs and promotes local culture and products', NULL, NULL, N'8.9')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (8, N'8.a', N'Increase Aid for Trade support for developing countries, in particular least developed countries, including through the Enhanced Integrated Framework for Trade-related Technical Assistance to Least Developed Countries', NULL, NULL, N'8.a')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (8, N'8.b', N'By 2020, develop and operationalize a global strategy for youth employment and implement the Global Jobs Pact of the International Labour Organization', NULL, NULL, N'8.b')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (9, N'9.1', N'Develop quality, reliable, sustainable and resilient infrastructure, including regional and trans-border infrastructure, to support economic development and human well-being, with a focus on affordable and equitable access for all', NULL, NULL, N'9.1')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (9, N'9.2', N'Promote inclusive and sustainable industrialization and, by 2030, significantly raise industry’s share of employment and gross domestic product, in line with national circumstances, and double its share in least developed countries', NULL, NULL, N'9.2')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (9, N'9.3', N'Increase the access of small-scale industrial and other enterprises, in particular in developing countries, to financial services, including affordable credit, and their integration into value chains and markets', NULL, NULL, N'9.3')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (9, N'9.4', N'By 2030, upgrade infrastructure and retrofit industries to make them sustainable, with increased resource-use efficiency and greater adoption of clean and environmentally sound technologies and industrial processes, with all countries taking action in accordance with their respective capabilities', NULL, NULL, N'9.4')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (9, N'9.5', N'Enhance scientific research, upgrade the technological capabilities of industrial sectors in all countries, in particular developing countries, including, by 2030, encouraging innovation and substantially increasing the number of research and development workers per 1 million people and public and private research and development spending', NULL, NULL, N'9.5')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (9, N'9.a', N'Facilitate sustainable and resilient infrastructure development in developing countries through enhanced financial, technological and technical support to African countries, least developed countries, landlocked developing countries and small island developing States', NULL, NULL, N'9.a')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (9, N'9.b', N'Support domestic technology development, research and innovation in developing countries, including by ensuring a conducive policy environment for, inter alia, industrial diversification and value addition to commodities', NULL, NULL, N'9.b')
INSERT [dbo].[Target] ([Goal_ID], [Target_ID], [Target_DescEn], [Target_DescAr], [Type_ID], [Target_Code]) VALUES (9, N'9.c', N'Significantly increase access to information and communications technology and strive to provide universal and affordable access to the Internet in least developed countries by 2020', NULL, NULL, N'9.c')
